window.bookSummaryJSON = "<p><b>The galaxy’s worst bounty hunter just might be its most relentless hero.</b></p> <p>Esper Richelieu is a wizard with a mission: To make the galaxy a better place one lost soul at a time.</p> <p>Donning the trappings of an interstellar bounty hunter, she delves into the galaxy’s underworld to search out those most in need of help. Whether it’s a teenage runaway or an actor kidnapped by cultists, the victim comes first.</p> <p>Money is an afterthought. That confuses a lot of clients.</p> <p>But sometimes the best way to get someone to accept the help they need is to convince them to pay for it. Other times, clients unwittingly fund their own reparations by hiring the last person who’d want to aid them in continuing their wicked ends.</p> <p>But are pure intentions enough against the vilest forces in the galaxy?</p>"; 
